import { useEffect, useState } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { BrowserRouter, Routes, Route, Link , useParams } from "react-router-dom";
import FilmsContainer from "./FilmsContainer"
import axios from "axios";
import cassete from './casette.png';

const FilmDiv = (props) => {
  const [list, setList] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:8080/api/film/ranking/" + props.data)
    .then(res => {
        console.log(res.data)
        setList(res.data)
        })
    .catch(err => {
        console.log(err)
    })
}, [setList]);

  return (
    <Link to={`/film/${props.data.id}`}>
    <Row className = "filmDiv">
        <Col className="filmInfo" ><img src={cassete} style={{width: "64px", height: "128px"}}/></Col>
        <Col className="filmInfo">{props.data.avgGrade}</Col>
        <Col className="filmInfo">{props.data.title}</Col>
        <Col className="filmInfo">{props.data.premiereDate}</Col>
    </Row>
    </Link>
    )
}

const Search = () => {
  const [inf, setInf] = useState(-1);

  useEffect(() => {
    axios.get("http://localhost:8080/api/film/ranking/" + inf)
    .then(res => {
        console.log(res.data)
        setList(res.data)
        })
    .catch(err => {
        console.log(err)
    })
}, [setList, inf]);

  return (
      <Container>
        <h1 style={{textAlign: "center", margin: "2pc"}}> Search films </h1>
        <button onClick={setInf(1)}/>
        {console.log(inf)}
        <FilmDiv data={inf}/>
      </Container>
    )
}

export default Search;
